import 'Attributes.dart';class Catalog {  Catalog({    required  this.id,    required this.nameUz,    required this.nameRu,    required this.nameEn,    required this.price,    required this.discountPrice,    required this.aboutUz,    required this.aboutRu,    required this.aboutEn,    required this.image,    required this.countryId,    required this.attributeId,    required this.categoryId,    required this.countryUz,    required this.countryRu,    required this.countryEn,    required this.attributes,});  Catalog.fromJson(dynamic json) {    id = json['id'];    nameUz = json['name_uz'];    nameRu = json['name_ru'];    nameEn = json['name_en'];    price = json['price'];    discountPrice = json['discount_price'];    aboutUz = json['about_uz'];    aboutRu = json['about_ru'];    aboutEn = json['about_en'];    image = json['image'] != null ? json['image'].cast<String>() : [];    countryId = json['country_id'];    attributeId = json['attribute_id'] != null ? json['attribute_id'].cast<int>() : [];    categoryId = json['category_id'];    countryUz = json['country_uz'];    countryRu = json['country_ru'];    countryEn = json['country_en'];    if (json['attributes'] != null) {      attributes = [];      json['attributes'].forEach((v) {        attributes.add(Attributes.fromJson(v));      });    }  } late int id; late String nameUz; late String nameRu; late String nameEn; late int price; late int discountPrice; late String aboutUz; late String aboutRu; late String aboutEn; late List<String> image; late int countryId; late List<int> attributeId; late int categoryId; late String countryUz; late String countryRu; late String countryEn; late List<Attributes> attributes;  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['id'] = id;    map['name_uz'] = nameUz;    map['name_ru'] = nameRu;    map['name_en'] = nameEn;    map['price'] = price;    map['discount_price'] = discountPrice;    map['about_uz'] = aboutUz;    map['about_ru'] = aboutRu;    map['about_en'] = aboutEn;    map['image'] = image;    map['country_id'] = countryId;    map['attribute_id'] = attributeId;    map['category_id'] = categoryId;    map['country_uz'] = countryUz;    map['country_ru'] = countryRu;    map['country_en'] = countryEn;    if (attributes != null) {      map['attributes'] = attributes.map((v) => v.toJson()).toList();    }    return map;  }}